import React from 'react'

function List (props) {

    const items = props.items

    const skillStyle = {
        position: "relative",
        float: "left",
        marginLeft: "2rem",
    }

    return (
        <ul>
            {items.map((item) => {

                item = item.split(":");
                if (item.length === 2) {
                    const skillName = "<b>" + item[0];
                    item = item[1];
                } else {
                    item = item[0];
                }

                return (<li style={skillStyle}>{item}</li>);
            })}
        </ul>
    );
}

export default List;
